import React, { Component } from 'react';
import './App.css';
import Posts from './PostsContainer/PostsContainer';
import EventfulContainer from './EventfulContainer/EventfulContainer';

class App extends Component {
  render() {
    return (
      <div className="App">
          <EventfulContainer />
          <Posts />

      </div>
    );
  }
}

export default App;
